import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from '../serviceWorker';
import withConnect from '../components/withConnect';
import TextAnnotation from '../components/text-annotation';
import { methods, samplePayload } from '../components/text-annotation/payload';
import { AnnotationType } from '../types';

const TextAnnotationComp: React.FC = withConnect({ type: AnnotationType.TEXT, methods, samplePayload })(TextAnnotation);

ReactDOM.render(
  <TextAnnotationComp />,
  document.getElementById('root'),
);

serviceWorker.unregister();
